

CREATE DATABASE manufacturing_db;
use manufacturing_db;
CREATE TABLE manufacturing (
  id BIGINT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  doc_num VARCHAR(100),
  doc_date DATETIME,
  buyer VARCHAR(255),
  cust_code VARCHAR(100),
  cust_name VARCHAR(255),
  delivery_period VARCHAR(100),
  department_name VARCHAR(255),
  designer VARCHAR(100),
  emp_code VARCHAR(100),
  emp_name VARCHAR(255),
  machine_code VARCHAR(100),
  machine_name VARCHAR(255),
  operation_code VARCHAR(100),
  operation_name VARCHAR(255),
  item_code VARCHAR(100),
  item_name VARCHAR(255),
  produced_qty INT DEFAULT 0,
  rejected_qty INT DEFAULT 0,
  processed_qty INT DEFAULT 0,
  per_day_machine_cost DECIMAL(18,2) DEFAULT 0.00,
  total_value DECIMAL(18,2) DEFAULT 0.00,
  repeat_flag TINYINT(1) DEFAULT 0,
  wo_qty INT DEFAULT 0,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP NULL ON UPDATE CURRENT_TIMESTAMP
);

CREATE INDEX idx_mfg_docdate ON manufacturing (doc_date);
CREATE INDEX idx_mfg_buyer ON manufacturing (buyer(100));
CREATE INDEX idx_mfg_empcode ON manufacturing (emp_code);
CREATE INDEX idx_mfg_machinecode ON manufacturing (machine_code);
CREATE INDEX idx_mfg_dept ON manufacturing (department_name(100));

USE manufacturing_db;

ALTER TABLE manufacturing
  ADD COLUMN press_qty INT DEFAULT 0,
  ADD COLUMN today_manufactured_qty INT DEFAULT 0,
  ADD COLUMN totalqty INT DEFAULT 0,
  ADD COLUMN production_yield DECIMAL(10,6),
  ADD COLUMN rejection_rate_calc DECIMAL(10,6),
  ADD COLUMN on_time_delivery VARCHAR(50),
  ADD COLUMN cost_per_unit DECIMAL(18,6);
  

-- 1. Overall totals & rates
SELECT
  COALESCE(SUM(produced_qty),0)                            AS total_produced_qty,
  COALESCE(SUM(rejected_qty),0)                            AS total_rejected_qty,
  COALESCE(SUM(processed_qty),0)                           AS total_processed_qty,
  COALESCE(SUM(total_value),0)                             AS total_value,
  ROUND(
    CASE WHEN COALESCE(SUM(produced_qty),0)=0 THEN 0
    ELSE SUM(rejected_qty)/SUM(produced_qty) END, 2)      AS overall_rejection_rate,
  ROUND(
    CASE WHEN COALESCE(SUM(produced_qty),0)=0 THEN 0
    ELSE (SUM(produced_qty)-SUM(rejected_qty))/SUM(produced_qty) END, 2) AS overall_yield
FROM manufacturing;


-- 2. Monthly trend – production, rejection, value, rejection rate
--    (for line charts / time-series)

SELECT
  DATE_FORMAT(doc_date, '%Y-%m') AS month_year,
  SUM(produced_qty)              AS produced_qty,
  SUM(rejected_qty)              AS rejected_qty,
  SUM(total_value)               AS total_value,
  ROUND(
    CASE WHEN SUM(produced_qty)=0 THEN 0
         ELSE SUM(rejected_qty)/SUM(produced_qty) END
  , 4) AS rejection_rate
FROM manufacturing
GROUP BY month_year
ORDER BY month_year;

-- 3. Monthly production growth % (MoM change) – uses window function

WITH monthly AS (
  SELECT
    DATE_FORMAT(doc_date, '%Y-%m') AS month_year,
    SUM(produced_qty)             AS produced_qty
  FROM manufacturing
  GROUP BY month_year
)
SELECT
  month_year,
  produced_qty,
  LAG(produced_qty) OVER (ORDER BY month_year) AS prev_month_produced,
  ROUND(
    (produced_qty - LAG(produced_qty) OVER (ORDER BY month_year))
    / NULLIF(LAG(produced_qty) OVER (ORDER BY month_year),0)
  * 100, 2) AS production_growth_pct
FROM monthly
ORDER BY month_year;

-- 4. Buyer-wise summary – volume, value, rejection, yield
------------------------------------------------------------------
SELECT
  buyer,
  SUM(produced_qty)  AS produced_qty,
  SUM(rejected_qty)  AS rejected_qty,
  SUM(total_value)   AS total_value,
  COUNT(DISTINCT doc_num) AS order_count,
  ROUND(
    CASE WHEN SUM(produced_qty)=0 THEN 0
         ELSE SUM(rejected_qty)/SUM(produced_qty) END
  , 4) AS rejection_rate,
  ROUND(
    CASE WHEN SUM(produced_qty)=0 THEN 0
         ELSE (SUM(produced_qty)-SUM(rejected_qty))/SUM(produced_qty) END
  , 4) AS yield_rate
FROM manufacturing
GROUP BY buyer
ORDER BY produced_qty DESC;


-- 5. top 10 Employee performance

SELECT
  emp_code,
  emp_name,
  SUM(COALESCE(produced_qty,0)) AS produced_qty,
  SUM(COALESCE(rejected_qty,0)) AS rejected_qty,
  COUNT(DISTINCT doc_num)       AS orders_handled,
  ROUND(CASE WHEN SUM(COALESCE(produced_qty,0))=0 THEN 0 ELSE SUM(rejected_qty)/SUM(produced_qty) END, 6) AS rejection_rate
FROM manufacturing
GROUP BY emp_code, emp_name
ORDER BY rejected_qty DESC;

-- 6. top 10 Machine performance & costing

SELECT
  machine_code,
  COALESCE(machine_name, machine_code) AS machine_name,
  SUM(COALESCE(produced_qty,0))         AS produced_qty,
  SUM(COALESCE(rejected_qty,0))         AS rejected_qty,
  SUM(COALESCE(per_day_machine_cost,0)) AS total_machine_cost,
  ROUND(CASE WHEN SUM(COALESCE(produced_qty,0))=0 THEN 0 ELSE SUM(COALESCE(per_day_machine_cost,0))/SUM(COALESCE(produced_qty,0)) END, 6) AS avg_cost_per_unit,
  ROUND(CASE WHEN SUM(COALESCE(produced_qty,0))=0 THEN 0 ELSE SUM(COALESCE(rejected_qty,0))/SUM(COALESCE(produced_qty,0)) END, 6) AS rejection_rate
FROM manufacturing
GROUP BY machine_code, machine_name
ORDER BY total_machine_cost DESC;


-- 7. Department comparison

SELECT
  department_name,
  SUM(COALESCE(produced_qty,0)) AS produced_qty,
  SUM(COALESCE(rejected_qty,0)) AS rejected_qty,
  ROUND(CASE WHEN SUM(COALESCE(produced_qty,0))=0 THEN 0 ELSE SUM(rejected_qty)/SUM(produced_qty) END, 6) AS rejection_rate
FROM manufacturing
GROUP BY department_name
ORDER BY produced_qty DESC;


-- 8. Repeat orders analysis

SELECT
  CASE WHEN COALESCE(repeat_flag,0)=1 THEN 'Repeat' ELSE 'New' END AS order_type,
  COUNT(*) AS records,
  SUM(COALESCE(produced_qty,0)) AS produced_qty,
  SUM(COALESCE(rejected_qty,0)) AS rejected_qty
FROM manufacturing
GROUP BY order_type;

-- 09. Employee quality score (1 - rejection rate)
------------------------------------------------------------------
SELECT
  emp_code,
  emp_name,
  SUM(produced_qty) AS produced_qty,
  SUM(rejected_qty) AS rejected_qty,
  ROUND(SUM(rejected_qty)/NULLIF(SUM(produced_qty),0),4)            AS rejection_rate,
  ROUND(1 - SUM(rejected_qty)/NULLIF(SUM(produced_qty),0),4)        AS quality_score
FROM manufacturing
GROUP BY emp_code, emp_name
HAVING SUM(produced_qty) > 0
ORDER BY quality_score DESC;


-- 10. Machine quality performance – machine-wise rejection rate
------------------------------------------------------------------
SELECT
  machine_code,
  SUM(produced_qty) AS produced_qty,
  SUM(rejected_qty) AS rejected_qty,
  ROUND(SUM(rejected_qty)/NULLIF(SUM(produced_qty),0),4) AS rejection_rate
FROM manufacturing
GROUP BY machine_code, machine_name
HAVING SUM(produced_qty) > 0
ORDER BY rejection_rate DESC
LIMIT 10;

  -- 11. High-risk items – items with highest rejection rate
------------------------------------------------------------------
SELECT
  item_code,
  item_name,
  SUM(produced_qty) AS produced_qty,
  SUM(rejected_qty) AS rejected_qty,
  ROUND(SUM(rejected_qty)/NULLIF(SUM(produced_qty),0),4) AS rejection_rate
FROM manufacturing
GROUP BY item_code, item_name
HAVING SUM(produced_qty) >= 100   -- ignore low volume items
ORDER BY rejection_rate DESC
LIMIT 10;



-- 12. Top 10 machines by rejected_qty

SELECT machine_code, COALESCE(machine_name,machine_code) AS machine_name, SUM(rejected_qty) AS rejected_qty
FROM manufacturing
GROUP BY machine_code, machine_name
ORDER BY rejected_qty DESC
LIMIT 10;

-- 13. Top 10 employees by rejection rate 

SELECT emp_code, emp_name,
       SUM(produced_qty) AS produced_qty,
       SUM(rejected_qty) AS rejected_qty,
       ROUND(SUM(rejected_qty)/NULLIF(SUM(produced_qty),0),6) AS rejection_rate
FROM manufacturing
GROUP BY emp_code, emp_name
ORDER BY rejection_rate DESC
LIMIT 10;
  
